(172175, '30C24475-B9D8-455C-8E84-9AF5C3158FA9', 'The video is kind of lame...I can''t help looking at the opportunity with all these amazing women with amazing stories and something to say and they just cut together sound bite platitudes and cliches with no emotional impact....do they have the profile pages? (Dont mean to be negative...the clothes look great, photos are excellent, you look gorgeous, and it is great for you to be included...I just can''t stand mediocre advertising execution)', 'David', 'Nitzan', '2015-09-09T11:54:39'),
