(172305, 'A08D9019-6FA6-439F-808D-CFCF00287F51', 'I think what makes me ok with it is that I like the theme of highlighting women in all different shapes and sizes for their leadership overall. And then I stopped expecting it to be anything bigger than that. ', 'Nitzan', 'David', '2015-09-09T12:05:55'),
