(172250, '541AB810-AA6E-4BB7-BE0C-2553C1715A39', 'I agree with all of that. ', 'Nitzan', 'David', '2015-09-09T12:10:17'),
(172290, '2CB30CFE-7090-49EB-A65F-A39097B54738', 'I also think it''s easier to do a campaign about body image and beauty that isn''t terribly complex. Leadership is much harder to pull off. ', 'Nitzan', 'David', '2015-09-09T12:10:56'),
